import React from 'react'
import Navbar from './components/UI/Navbar'

import { BrowserRouter as Router, Link, Switch } from 'react-router-dom'

const App = () => {
  return (
    <div>
      <Router>
        <Route path='/' exact component={Navbar} />
      </Router>
    </div>
  )
}

export default App
